import { Navigate, Route} from "react-router-dom";

const PrivateRoute = (props) => {
  return (
    <Route
      {...rest}
      element={(props) =>
        props.isLoggedIn ? <Element {...props} /> : <Navigate to="/login" />
      }
    />
  );
};

export default PrivateRoute;
